FICO SEM ENTENDER O PORQUÊ AINDA NOSSO PRESIDENTE NÃO PRENDEU GILMAR MENDES, LEVANDOSK, FAKIN, BARROSO, TOFOLLI,  CARMEM LÚCIA E ALEXANDRE DE MORAES? O MUNDO TODO ESTÁ VENDO O QUE ESSES MINISTROS FANTASIADOS DE TOGA ANDA FAZENDO À NAÇÃO BRASILEIRA. QUALQUER PAÍS SÉRIO JÁ TERIA FEITO ESSA LIMPEZA. CORAGEM PRESIDENTE, O MUNDO TE APOIA. SAIA DESSA, QUE MEDO É ESSE? VAI ENTREGAR A SUA NAÇÃO E SEU POVO DE MÃO BEIJADA AS ATROCIDADES DO COMUNISMO? ACORDA!! FAÇA A LIMPEZA.
FAÇA UM PRONUNCIAMENTO AO MUNDO E DIGA:
EU, JAIR MESSIAS BOLSONARO, PRESIDENTE DA REPÚBLICA FEDERATIVA DO BRASIL  NÃO QUERIA TOMAR A DECISÃO QUE ORA VOU TOMAR; PROCUREI DE TODAS AS MANEIRAS AGIR DENTRO DA CONSTITUIÇÃO E, PEDIA SEMORE QUE OS DEMAIS PODERES ASSIM FIZESSE COISA QUE ATÉ O MOMENTO O PODER JUDICIÁRIO NÃO CUMPRIU E MUITO MENOS CUMPRE, OBRIGADO-ME A AGIR DE FORMA LEGAL PRENDENDO-OS E SUBSTITUINDO-OS.
OS MINISTROS ACIMA NESSE PERÍODO DE QUASE 4 ANOS SÓ COMETERAM CRIMES:
A) LIBERTAR CONDENADOS POR TRÊS ESTÂNCIAS ;
B) INTERFERIREM NÓS OUTROS PODERES ILEGALMENTE;
C) RASGAREM A CONSTITUIÇÃO 24 HORAS POR DIA;
D) PRENDEREM DEPUTADOS, NÃO OBEDECENDO O ART 53 DA CF:
É) INTERFERIREM EM TODAS AÇÕES DO EXECUTIVO QUE BENEFICIA O POVO
F) INTERPRETAR A CONSTITUIÇÃO AO SEU BEL PRAZER;
G) TIRAR A LIBERDADE DE EXPRESSÃO E DE IR E VIR DE JORNALISTAS E O POVO;
H) FRAUDAREM AS ELEIÇÕES A FAVOR O LADRÃO LULA, ETC
